void gen_6(){
    ll fact[30]; fact[0] = 1;
    for(int i=1; i<=20; ++i) fact[i] = fact[i-1]*i;
    for(ll i=1; i<=20000; ++i){
        ll N = i*i*i*i;
        printf("T[%lld]=\"", N);
        --N;
        ll l=1;
        while(N>=fact[l]){
            N -= fact[l];
            ++l;
        }
        char str[26]; str[l] = 0;
        bool chk[26]; memset(chk, 0, sizeof(chk));
        for(int j=0; j<l; ++j){
            int c = N / fact[l-j-1];
            int p;
            for(p=0;c>=0;++p){
                if(!chk[p]) --c;
            }
            --p;
            str[j] = 'a' + p;
            chk[p] = true;
            N %= fact[l-j-1];
        }
        printf("%s\"\n", i==10000?TROLL_CSTR:str);
    }
}

